import React, { useState } from "react";
import "./AssignmentSubmission.css";

const AssignmentSubmission = () => {
  const [submittedFile, setSubmittedFile] = useState(null);
  const [submissionStatus, setSubmissionStatus] = useState("No attempt");

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setSubmittedFile(file);
      setSubmissionStatus("Submitted");
    }
  };

  const handleSubmit = () => {
    if (submittedFile) {
      alert("Assignment submitted: " + submittedFile.name);
    } else {
      alert("Please choose a file to submit.");
    }
  };

  const handleEdit = () => {
    alert("You can now edit your submission.");
  };

  return (
    <div className="assignment-page">
      <div className="assignment-container">
        <h4 className="assignment-title">Principles of Management</h4>

        <div>
          <h5 className="assignment-subheading">Assignment 01</h5>
          <p className="assignment-dates">Opened: Saturday, 05 April 2025, 12:00 AM</p>
          <p className="assignment-dates">Due: Saturday, 12 April 2025, 12:00 AM</p>

          <button className="mark-as-done-btn">Mark as done</button>

          <table className="status-table">
            <thead>
              <tr>
                <th colSpan="2">Submission Status</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Submission Status</td>
                <td>{submissionStatus}</td>
              </tr>
              <tr>
                <td>Grading Status</td>
                <td>{submissionStatus === "Submitted" ? "Pending" : "Not Graded"}</td>
              </tr>
              <tr>
                <td>Time Remaining</td>
                <td>3 days and 5 hours</td>
              </tr>
              <tr>
                <td>Last Modified</td>
                <td>{submittedFile ? submittedFile.name : "-"}</td>
              </tr>
              <tr>
                <td>Submission Comments</td>
                <td>{submittedFile ? "You already submitted." : "Comments"}</td>
              </tr>
            </tbody>
          </table>

          <div className="submission-actions">
            <input
              type="file"
              accept=".pdf,.doc,.docx,.png,.jpg,.jpeg"
              onChange={handleFileChange}
              style={{ marginBottom: "10px" }}
            />
            {submissionStatus === "Submitted" ? (
              <button className="submit-btn" onClick={handleEdit}>
                Edit Submission
              </button>
            ) : (
              <button className="submit-btn" onClick={handleSubmit}>
                Add Submission
              </button>
            )}
            <p>
              {submissionStatus === "Submitted"
                ? "You have already submitted your assignment."
                : "You have not made a submission yet"}
            </p>
            <button className="back-btn">Back To Course</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AssignmentSubmission;
